import React from 'react'

class Form extends React.Component
{
    constructor(props) {
        super(props);
    }

    render() {
        return (<div className="form">
            <h2>Add task</h2>
            <form>
                <input type="text" name="exercise" />
                <input type="number" name="duration" />
                <button>Add</button>
            </form>
        </div>);
    }
}

export default Form;
